script: |
  super -f text -I q6068.spq | sort > q6068.out

inputs:
  - name: q6068.spq
    data: |
      SELECT 46 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 + + col0 IN ( - 7, - col0 + - col2, + - col0 * CAST ( - col0 AS INTEGER ) );
  - name: tab2

outputs:
  - name: q6068.out
    data: |
      46
      46
      46
